import image from '../assets/Unknown.jpeg'

export const data = [
    {
        image: `${image}`,
        name: 'Producto 1',
        description: 'Producto 2',
        quantity: 1,
    },
    {
        image: `${image}`,
        name: 'Producto 2',
        description: 'Producto 3',
        quantity: 1,
    }
]
